Yóllotl, del náhuatl, “corazón”.

“La raíz de yóllotl es la misma que la del verbo yoli que significa "vivir". Dado que la lengua náhuatl es polisintética o sea que estructura voca­blos compuestos, dispone de un rico conjunto de afijos, partículas que se anteponen, intercalan o posponen, siempre integrándose al vocablo, confiriéndole diversos sen­tidos. Así, en tanto que yoliliztlí, es "acción de vivir", yóllotl es forma abstracta que denota lo que es propio o esencial de lo enunciado por la raíz del vocablo. En consecuencia la voz yóllotl significa la esencia o fuerza de la vida, lo que es propio del ser viviente.”- Miguel León Portilla, UNAM.";}i:238;a:1:{s:14:"comments_count";i:2;}i:239;a:1:{s:11:"likes_count";i:35;}i:240;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvMdFSj4y7";}i:241;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118772527_751951212267787_6493189688001719429_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=107&_nc_ohc=Fns8AEbBy88AX-illVC&oh=5d333f6d80694ac80220149ca3ba791f&oe=5F7E41DC";}i:242;a:1:{s:4:"type";s:5:"image";}i:243;a:1:{s:8:"owner_id";i:685903080;}i:244;a:1:{s:14:"owner_username";s:0:"";}i:245;a:1:{s:14:"owner_fullname";s:0:"";}i:246;a:1:{s:9:"owner_pic";s:0:"";}i:247;a:1:{s:2:"id";s:19:"2391181204563821482";}i:248;a:1:{s:10:"short_code";s:11:"CEvLqLzngOq";}i:249;a:1:{s:12:"created_time";i:1599271254;}i:250;a:1:{s:7:"caption";s:459:"For this week’s YouTube episode we made a ruby chocolate mirror glaze forest cake. Really not as difficult as you may think. You can check out this video on my YouTube channel shortly, link is in my profile or below.

